تنظيف البيت عبادة لمن صلحت نيتها 
قال ﷺ :"طهــــروا افنيتكم فإن اليهــود لا تطهر افنيتهـا“

{الجامع الصغير للالباني 3539}

فطريقتهم أي (السلف) تتضمن إثبات الأسماء والصفات مع نفي مماثلة المخلوقات إثباتا بلا تشبيه وتنزيها بلا تعطيل كما قال تعالى : {لَيْسَ كَمِثْلِهِ شَيْءٌ وَهُوَ السَّمِيعُ البَصِيرُ}
ففي قوله : {لَيْسَ كَمِثْلِهِ شَيْءٌ)} رد للتشبيه والتمثيل.. 
وقوله : {وَهُوَ السَّمِيعُ البَصِيرُ}=
